<html>
<head>
  <title>Screenshot</title>
  <style>
    body {
      font-family: Arial, sans-serif;
      width: 200px;
      height: 100px;
      font-size: 14px;
      text-align: center;
      padding: 20px;
      border: 1px solid #ccc;
      border-radius: 5px;
