Static variables are those variables that are declared with the static keyword. They are initialized only once at compile time and they retain their values between different function calls. Static variables are stored in the initialized data segment of the memory.
Static variables are of two types:
1. Internal Static Variables: These are the variables that are declared with the static keyword inside a function. They are initialized only once at compile time and they retain their values between different function calls.
2. External Static Variables: These are the variables that are declared with the static keyword outside a function. They are initialized only once at compile time and they retain their values between different function calls. They are accessible only within the file in which they are declared.
Register variables are those variables that are declared with the register keyword. They are stored in the CPU registers instead of the RAM. This makes the access to these variables faster. The register variables are used to store the variables that are used frequently in a program.
The main difference between static variables and register variables is that static variables are stored in the memory and retain their values between different function calls, whereas register variables are stored in the CPU registers and do not retain their values between different function calls.
